import React from "react";
import Cell from "./Cell";
import "./GameStyles";

const Board = () => {
  return (
    <div className="game-board">
      {Array(9)
        .fill()
        .map((item, index) => (
          <Cell></Cell>
        ))}
    </div>
  );
};
export default Board;
